import{_ as e,o as t,c as o,a}from"./app.31a0d9f1.js";const r="/developer-cheat-sheet/assets/maslowPyramid.93648129.jpeg",n="/developer-cheat-sheet/assets/dikw-pyramid.e627fe34.png",f=JSON.parse('{"title":"Knowledge","description":"","frontmatter":{},"headers":[{"level":2,"title":"Why? \u{1F914}","slug":"why-\u{1F914}","link":"#why-\u{1F914}","children":[]},{"level":2,"title":"What? \u{1F913}","slug":"what-\u{1F913}","link":"#what-\u{1F913}","children":[]},{"level":2,"title":"For what? \u{1F632}","slug":"for-what-\u{1F632}","link":"#for-what-\u{1F632}","children":[]},{"level":2,"title":"How? \u{1F9D0}","slug":"how-\u{1F9D0}","link":"#how-\u{1F9D0}","children":[]}],"relativePath":"learn/recurrence/knowledge/index.md"}'),s={name:"learn/recurrence/knowledge/index.md"},i=a('<h1 id="knowledge" tabindex="-1">Knowledge <a class="header-anchor" href="#knowledge" aria-hidden="true">#</a></h1><h2 id="why-\u{1F914}" tabindex="-1">Why? \u{1F914} <a class="header-anchor" href="#why-\u{1F914}" aria-hidden="true">#</a></h2><p>Why do we want to study and understand knowledge?</p><p>Because we can only observe the world from our perspective, our shoes. Knowledge is what allowed our ancestors to survive and eat the things that would not kill us.</p><p><strong>Maslow pyramid</strong></p><p><img src="'+r+'" alt="Maslow pyramid"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Nowadays in order to survive we need a job and thus (as software engineers) <strong>knowledge of our craft</strong> is what will allow us to cover our physiological needs and <strong>survive</strong>.</p></div><h2 id="what-\u{1F913}" tabindex="-1">What? \u{1F913} <a class="header-anchor" href="#what-\u{1F913}" aria-hidden="true">#</a></h2><p><strong>DIKW Pyramid</strong></p><p><img src="'+n+'" alt="DIKW pyramid"></p><table><thead><tr><th>Level</th><th>Definition</th><th>Examples</th></tr></thead><tbody><tr><td><strong>Noise</strong></td><td>Physic signal (visual, audible...) not standardized, without pattern.</td><td><em>\xF1laksjdfk, xxi, k34hsksi29sk2, ]})\xBF:?({#!!, :-*, \u2026\u200B, kid clapping, hit the piano keys...</em></td></tr><tr><td><strong>Data</strong></td><td>Magnitude of some concrete qualitative or quantitative characteristic, without context or meaning, with a precise. <strong>format</strong></td><td><em>1850, 7009.7 thousands of millions, 9,6%, (, ., !, 8-o,...</em></td></tr><tr><td><strong>Information</strong></td><td>Application of <strong>structured order</strong> over data with the goal of giving them meaning. Information is organized data, related element inside a system structure, describes in a concise <strong>language</strong></td><td><em>1850 son las retrasmisiones en directo de las campanadas de fin de a\xF1o que emocionaron al 9,6% de los 7009.7 miles de millones de personas que lo celebramos en 2014 a la vez, decimocuarto aniversario anual dentro del siglo xxi.</em></td></tr><tr><td><strong>Knowledge</strong></td><td><strong>Comprehend</strong> a specific subject, trough experience or education. It builds on top of information to provide context. The key difference between knowledge and information is that knowledge gives us power to make decisions.</td><td><em>You know how to hang out parties you usually attend</em></td></tr><tr><td><strong>Wisdom</strong></td><td>Is the <strong>optimal judgement</strong>, which reflects a deep understanding of people, things, events or situations.</td><td><em>Knows how to enjoy being with others in any party</em></td></tr></tbody></table><h2 id="for-what-\u{1F632}" tabindex="-1">For what? \u{1F632} <a class="header-anchor" href="#for-what-\u{1F632}" aria-hidden="true">#</a></h2><h2 id="how-\u{1F9D0}" tabindex="-1">How? \u{1F9D0} <a class="header-anchor" href="#how-\u{1F9D0}" aria-hidden="true">#</a></h2>',13),d=[i];function l(h,c,g,p,u,w){return t(),o("div",null,d)}const _=e(s,[["render",l]]);export{f as __pageData,_ as default};
